                        <html><head><meta charset="utf-8"></head><body>
<p>Бирка двойная 75*100 под щипцы с глой с металлическим наконечником. <br />Часть "ПАПА" имеет стандартные размеры 61*80 мм, а часть "МАМА" имеет увеличенный размер 75*100 мм, что позволяет нанести на бирку более крупный номер и использовать ее для животных с большим волосяным покровом. <br />Ипользуется для маркировки крупного рогатого скота. По сравнению с бирками под шприцы без направляющей иглы, этот вариант имеет: <br />- Еще большую магкость и эластичность; <br />- Добавку антимикробного компонента;<br />- Более легкое вращение частей бирки относительно друг друга; <br />- Закрытое крепление в части "МАМА". <br />Для установки бирок используются щипцы с направляющей иглой для придания жестокости при пробивании уха. <br />Цвет: желтый. <br />Количество штук в упаковке: 100.</p>
</body></html>

